import React from "react";
import { Grid, Typography, Button } from "@material-ui/core";
import { useHistory } from "react-router-dom";

import FormLogin from "../../Components/FormLogin";
import { useStyles } from "./style";
import {
  goToCandidate,
  goToCompany,
  goToMentor,
} from "../../Routes/coordinators";

export default function SelectPage() {
  const classes = useStyles();
  const history = useHistory();

  const handleClickIndicado = () => {
    goToCandidate(history);
  };
  const handleClickIndicar = () => {
    goToMentor(history);
  };
  const handleClickContratar = () => {
    goToCompany(history);
  };

  return (
    <Grid container className={classes.root}>
      <Grid item className={classes.containerButtons} xs={12} sm={6}>
        <Typography className={classes.opcao} component="p" variant="h5">
          Vamos come√ßar a sua trilha!{" "}
        </Typography>
        <Button
          className={classes.button}
          variant="outlined"
          fullWidth
          onClick={handleClickIndicado}
        >
          Quero ser indicado
        </Button>
        <Button
          className={classes.button}
          variant="outlined"
          fullWidth
          onClick={handleClickIndicar}
        >
          Quero indicar
        </Button>
        <Button
          className={classes.button}
          variant="outlined"
          fullWidth
          onClick={handleClickContratar}
        >
          Quero contratar
        </Button>
      </Grid>
      <Grid className={classes.gridApresentacao} item xs={false} sm={6}></Grid>
    </Grid>
  );
}
